import React from "react";
import Column from "../../components/column";
import "../index.css"

const Table = ({ columns }) => {
    return (
        <div className="table">
            {
                columns.map((column, index) => {
                    return (
                        <Column column={column} key={index}/>
                    )
                })
            }
        </div>
    )
}

export default Table;
